import React from "react";

function Main() {
  <div className="boxes">
    <div className="box1">One</div>
    <div className="box2">two</div>
    <div className="box3">three</div>
    <div
      className="box4">
        four
    </div>
    <div className="box5">
      five
    </div>
  </div>;
}

export default Main;
